#include <iostream>#include <algorithm>#include <vector>using namespace std;bool compare(const string &str1,const string &str2) {	if (str1.length() != str2.length()) return str1.length() < str2.length();	else return str1 < str2;}int main() {	int n;	cin >> n;	vector<string>vec(n);	for (int i = 0; i < n;i++) {		cin >> vec[i];	}	sort(vec.begin(), vec.end(),compare);	vec.erase(unique(vec.begin(), vec.end()), vec.end());	for (int i = 0; i < vec.size(); i++) {		cout<< vec[i]<<endl;	}}